import React from "react";
import {Link} from "react-router-dom"

export default function Breadcrumb(){

    return (
        <nav aria-label="breadcrumb">
            <ol class="breadcrumb">
                <li class="breadcrumb-item" aria-current="page"><Link to="/">Home</Link></li>
            </ol>
        </nav>
    )
}
